import "./styled.js";
import Logo from "../../assets/images/logo.png";
import { Link } from "react-router-dom";
import { Anime, LogoUp, InputUp, BtnUp, FormUp, SpanUp } from "./styled.js";
export default function Register(){

    return(
        <Anime>
            <img src={Logo} alt="Logo Driven"/>
            <form>
                <input type="name" name="" id="" placeholder="Nome"/>
                <input type="text" name="" id="" placeholder="CPF"/>
                <input type="email" name="" id="" placeholder="E-mail"/>
                <input type="text" name="" id="" placeholder="Senha"/>
                <button disabled="disabled">CADASTRAR</button>
            </form>
            <Link to="/"><span>Já possuí uma conta? Entre</span></Link>
        </Anime>
    );
};
